import Header from '~/Layouts/components/Header';
import Upload from '~/pages/Upload';
function HeaderOnly({ children }) {
    return (
        <div>
            <Header />
            <div className="container">
                <Upload />
                <div className="content">{children}</div>
            </div>
        </div>
    );
}

export default HeaderOnly;
